            width: 100%;

            background: #601CFB;

        }

            flex-flow: row;
            width: fit-content;

            background: #CC0000;
            border: transparent solid;
            border-radius: 2px;

            font-family: Roboto;
            font-size: 14px;
            font-weight: 500;
            color: #fff;
            margin: 14px;
            margin-left: 40px;
        }

            flex-flow: column;
            align-items: center;
            justify-content: center;
                width: fit-content;
                height: fit-content;
                background: #601CFB;
                border-radius: 8px;
                box-shadow: 8px 8px 30px rgb(96 28 251 / 70%);
                font-family: Roboto,Arial,sans-serif;
                font-size: 22px;
                color: #fff;
                margin: 22px;
        }
        .alert{
        	display: flex;
        	flex-flow: row;
        	justify-content: center;
        	align-items: center;
            width: 100%;
            height: 60px;
            background-color: #fee0e0;
            margin-bottom: 20px;
            font-family: Roboto,Arial,sans-serif;
            font-size: 16px;
            color: #000;
        }
        .answers{
                width: 118px;
                height: 48px;
                border: transparent solid;
                font-family: roboto;
                font-size: 18px;
                border-radius: 4px;
                color: #1e1e1e;
                font-weight: 500;
                outline: none;
                background-color: #009688;
                margin: 17px;
                cursor: pointer;
        }
	</style>
